  //     <Route exact path="/" component={HomePage}></Route>
  //     <Route exact path="/landing-page" component={Landing}></Route>
  //   </Switch>
  // </NativeRouter>

  <NavigationContainer>
    <Stack.Navigator>
      <Stack.Screen
        name="Home"
        component={HomePage}
        options={{ title: "Welcome" }}
      />
      <Stack.Screen name="Landing" component={Landing} />
    </Stack.Navigator>
  </NavigationContainer>

  // <NativeRouter>
  //   <View style={styles.container}>
  //     <ImageBackground source={image} resizeMode="cover" style={styles.image}>
  //       <View style={styles.button}>
  //         <Button title="Travel Buddy" color="#244D9D" style={styles.button} />
  //       </View>
  //     </ImageBackground>
  //   </View>
  // </NativeRouter>
);

const styles = StyleSheet.create({
  container: {
    flex: 1,
  },
  image: {
    flex: 1,
    justifyContent: "center",
  },
  text: {
    color: "white",
    fontSize: 42,
    lineHeight: 84,
    fontWeight: "bold",
    textAlign: "center",
    backgroundColor: "#000000c0",
  },
  button: {
    marginBottom: 50,
    marginHorizontal: 15,
  },
});

export default App;
